import Accordion from './components/Accordion';

const items = [
    {
        title: 'aaa',
        content: 'aaaaa'
    },
    {
        title: 'bbb',
        content: 'bbbbb'
    },
    {
        title: 'ccc',
        content: 'aaacccccaa'
    }
];

export default () => {
    return <h1><Accordion items={items} /></h1>;
};
